-- Table: private_ci2027_001.lookup_growth_area

DROP TABLE IF EXISTS private_ci2027_001.lookup_growth_area;

CREATE TABLE IF NOT EXISTS private_ci2027_001.lookup_growth_area
(
    abbreviation integer NOT NULL,
    name_de character varying(150) COLLATE pg_catalog."default" NOT NULL,
    name_en character varying(150) COLLATE pg_catalog."default" NOT NULL,
    states private_ci2027_001.enum_state[],
     CONSTRAINT lookup_growth_area_pkey PRIMARY KEY (abbreviation)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS private_ci2027_001.lookup_growth_area OWNER to postgres;


select icode,langd,langd as kurze from private_ci2027_001.x3_wgkarte;  

UPDATE private_ci2027_001.lookup_growth_area
SET states =subquery.statesn    
FROM (select a.icode,a.laendernr,get_enum_states(a.laendernr) as statesn ,b.states from private_ci2027_001.x3_wgkarte as a
inner join private_ci2027_001.lookup_growth_area as b
on a.icode =b.abbreviation) AS subquery
WHERE private_ci2027_001.lookup_growth_area.abbreviation=subquery.icode;

DROP TABLE IF EXISTS private_ci2027_001.x3_wgkarte;
